	return (
		<CustomGridComponentWrapper>
			<div className="menu-quickItem">
				<a
					className="RecruitmentQuickMenu_RecruitmentQuickMenu__item__icon__oqlzc"
					href="/wdlist"
				>
					<span className="icon-svg-wrapper">
						<svg className="icon-svg" viewBox="0 0 32 32">
							<path d="M27.96 29.374a1 1 0 1 0 1.414-1.414l-8.667-8.667-.338-.294a1 1 0 0 0-1.357.05 9 9 0 1 1 2.24-3.676 1 1 0 1 0 1.909.6 11.01 11.01 0 0 0 .506-3.306c0-6.076-4.925-11-11-11-6.076 0-11 4.924-11 11 0 6.074 4.925 11 11 11 2.615 0 5.087-.918 7.04-2.549l8.253 8.256z" />
						</svg>
					</span>
				</a>
				<Link href="/wdlist">
					<span>
						채용공고
						<span className="Button_Button__endIcon__MpDfc">
							<span className="icon-svg">
								<svg className="icon-svg" viewBox="0 0 18 18">
									<path d="m11.955 9-5.978 5.977a.563.563 0 0 0 .796.796l6.375-6.375a.563.563 0 0 0 0-.796L6.773 2.227a.562.562 0 1 0-.796.796L11.955 9z" />
								</svg>
							</span>
						</span>
					</span>
				</Link>
			</div>
		</CustomGridComponentWrapper>
	);
}

const CustomGridComponentWrapper = styled(GridComponentWrapper)``;

export default GridArticle2;
